import React from 'react';
import {
  LineStage, 
  Steps, 
  Step, 
  PhaseCart,
  PhasePayment,
  PhaseReceipt, 
  PhaseTitle
} from './styles';

function StageComponent() { 
  return (
    <>
        <LineStage />
        <Steps>
          <Step>
            <PhaseCart/>
            <PhaseTitle>Cart</PhaseTitle>
          </Step>
          <Step>
            <PhasePayment/>
            <PhaseTitle>Payment options</PhaseTitle>
          </Step>
          <Step>
            <PhaseReceipt/>
            <PhaseTitle>Receipt</PhaseTitle>
          </Step>
        </Steps>
    </>
  );
}
export default StageComponent;
